import React from 'react'
import styled from 'styled-components'
import Card from '../components/Card'

const Container = styled.div`
   display: flex;
   justify-content: space-between;
   flex-wrap: wrap;
`;

const Image = styled.img`
   width: 100%;
   height: 202px;
`;

const Home = () => {
  return (
    <Container>
        <Card/>
        <Card/>
        <Card/>
        <Card/>
    </Container>
  )
}

export default Home
